import React from 'react';
import ProductDetail from './ProductDetail';

renderGetData = async() => {//needs to be at higher level.
    try {
        let response = await axios.get(`https://localhost:44394/api/reviews/${this.props.id}`)
        this.setState({reviews: [response.data]});
    } catch (err) {
        console.log(err);
    } 
}

function ProductsList(props) {
 
return (
    <div>
        <table>
            <thead>
                
            </thead>
            <tbody>
                
                {props.products.map(product => <ProductDetail key={product.id} id={product.id} name = {product.name} description = {product.description} price = {product.price}/>)}
            </tbody>            
        </table>
    </div>
                )
                }

export default ProductsList;
